import React from 'react'
import ReactDom from 'react-dom'

// CSS
import './index.css'

function BookList() {
  return (
    <section className='booklist'>
      <Book />
      <Book />
      <Book />
      <Book />
      <Book />
    </section>
  )
}

const Book = () => {
  return <article>
    <Image></Image>
    <Title />
    <Author />
  </article>
}

const Image = () => {
  return <img src='https://images-na.ssl-images-amazon.com/images/I/81kv0vHJ0QL._AC_UL240_SR240,240_.jpg' alt=''/>
}

const Title = () => <h1>TensorFlow book</h1>

const Author = () => <p>John Reed</p>

ReactDom.render(<BookList />, document.getElementById('root'))
